import './App.css';

function App() {
  return (
    <div style={{
      backgroundColor: '#0A0B0F',
      color: '#FFFFFF',
      minHeight: '100vh',
      overflow: 'hidden',
      position: 'relative',
    }}>
      {/* Navigation */}
      <nav style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '20px 40px',
        maxWidth: '1400px',
        margin: '0 auto',
      }}>
        <div style={{ 
          fontSize: '24px', 
          fontWeight: 'bold',
          display: 'flex',
          alignItems: 'center',
          gap: '8px',
        }}>
          <span style={{
            color: '#61DAFB',
            fontSize: '28px',
          }}>K</span>
          Portfolio
        </div>
        <div style={{
          display: 'flex',
          gap: '40px',
        }}>
          <a href="#home" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Home</a>
          <a href="#features" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Features</a>
          <a href="#product" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Product</a>
          <a href="#clients" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Clients</a>
        </div>
      </nav>

      {/* Hero Section */}
      <main style={{
        maxWidth: '1400px',
        margin: '60px auto',
        padding: '0 40px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        position: 'relative',
      }}>
        {/* Left Content */}
        <div style={{ maxWidth: '600px' }}>
          {/* Discount Badge */}
          <div style={{
            backgroundColor: 'rgba(97, 218, 251, 0.1)',
            padding: '8px 16px',
            borderRadius: '20px',
            display: 'inline-block',
            marginBottom: '24px',
          }}>
            <span style={{ color: '#61DAFB' }}>⚡ Full Stack Developer</span>
          </div>

          <h1 style={{
            fontSize: '72px',
            lineHeight: '1.1',
            marginBottom: '24px',
          }}>
            The Next
            <br />
            <span style={{ color: '#61DAFB' }}>Generation</span>
            <br />
            Developer.
          </h1>

          <p style={{
            color: '#8F9BA8',
            fontSize: '18px',
            lineHeight: '1.6',
            marginBottom: '40px',
            maxWidth: '500px'
          }}>
            Specializing in modern web development and innovative solutions.
            Creating seamless digital experiences with cutting-edge technology.
          </p>

          {/* Get Started Button */}
          <div style={{
            width: '150px',
            height: '150px',
            border: '1px solid #61DAFB',
            borderRadius: '50%',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            cursor: 'pointer',
            transition: 'all 0.3s ease',
            position: 'relative',
          }}>
            <div style={{
              color: '#61DAFB',
              textAlign: 'center',
            }}>
              Get
              <br />
              Started
            </div>
          </div>
        </div>

        {/* Right Content - 3D Elements */}
        <div style={{
          position: 'relative',
          width: '600px',
          height: '600px',
        }}>
          {/* Floating Cards */}
          {[0, 1, 2].map((index) => (
            <div key={index} style={{
              position: 'absolute',
              width: '400px',
              height: '250px',
              backgroundColor: 'rgba(97, 218, 251, 0.1)',
              borderRadius: '20px',
              top: '50%',
              right: '0',
              transform: `translateY(-50%) rotate(${-15 + index * 15}deg) translateX(${index * 20}px)`,
              backdropFilter: 'blur(10px)',
              border: '1px solid rgba(97, 218, 251, 0.2)',
              boxShadow: '0 0 30px rgba(97, 218, 251, 0.1)',
            }} />
          ))}

          {/* Floating Spheres */}
          {[1, 2, 3].map((index) => (
            <div key={`sphere-${index}`} style={{
              position: 'absolute',
              width: `${30 + index * 10}px`,
              height: `${30 + index * 10}px`,
              backgroundColor: '#61DAFB',
              borderRadius: '50%',
              top: `${20 + index * 30}%`,
              right: `${20 + index * 20}%`,
              opacity: '0.8',
              boxShadow: '0 0 30px rgba(97, 218, 251, 0.5)',
              animation: `float ${2 + index}s infinite ease-in-out`,
            }} />
          ))}
        </div>
      </main>
    </div>
  );
}

export default App;
